 - &DatasetID0001 {DataSetUUID: "F2BA669F-7E03-412B-AC5A-1793C85B7113", DataSetTypeCV: "Specimen time series", DataSetCode: "LR_SpecTS", DataSetTitle: "iUTAH synoptic sampling 2013-2014 for the Logan River specimen time series", DataSetAbstract: "This dataset consists of results from the 2013-2014 iUTAH GAMUT synoptic sample collection and analysis effort for the Logan River. Samples were collected by grab sampling once per month each month between June 2013 and June 2014. Analyses were performed for nutrients (total nigrogen and total phosphorus) at the USU Aquatic Biogeochemistry Laboratory, isotopes (D18O and D2H) at the University of Utah Stable Isotope Ratio for Environmental Research Laboratory, and bacteria (E.coli and total coliform) at the BYU Aanderud laboratory."}
